import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import Home from "./Home";
import Navbar from "./Navbar";

function App() {
    return(
        <div>
            <Navbar />
            <Routes>
                <Route path="/" element={<Home/>} />
            </Routes>
        </div>
    )
}

export default App;
